import { render } from "@testing-library/react";
// import React from "react";
import { Navigationes } from "./";
import React, { Component, useState, useEffect } from "react";
import BeforeAfterSlider from "react-before-after-slider";
import { Link } from "react-router-dom";
import { Helmet } from "react-helmet";
//import Testimonial from 'react-testimonial';
//import Carousel from 'react-multi-carousel';
import "react-multi-carousel/lib/styles.css";
import { MDBIcon, MDBContainer, MDBBtn } from "mdbreact";
import { PricingTable, PricingSlot, PricingDetail } from "react-pricing-table";
import { Card, CardHeader, CardBody, CardFooter } from "react-simple-card";
import Slider from "react-slick";
import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader
import Typical from "react-typical";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
const $ = window.$;

var c = 1,
  p = 1,
  o = 1,
  timer;
function Spanish(props) {
  const settingsimg = {
    dots: false,
    swipe: false,
    pauseOnHover: false,
    infinite: true,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    breakpoint: 0,
    speed: 4000,
    autoplaySpeed: 8000,

    responsive: [
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
          initialSlide: 1,
          speed: 2700,
          autoplaySpeed: 7000,
        },
      },
    ],
  };

  $.ajax({
    type: "GET",
    dataType: "json",
    url: "https://ip-api.io/json?api_key=ceae0f9fbb24a7f45f12d479595194fc",
    success: function (data) {
      console.log(
        "Your ip address is " +
          data.ip +
          " city: " +
          data.city +
          " region: " +
          data.region_name +
          " country: " +
          data.country_name
      );
      if (data.country_name == "France") {
        window.location.href = "https://cutoutwiz.com/fr";
      }
      if (data.country_name == "Spain") {
        window.location.href = "https://cutoutwiz.com/es";
      }
      if (data.country_name == "Germany") {
        window.location.href = "https://cutoutwiz.com/de";
      }
      if (data.country_name == "Netherlands") {
        window.location.href = "https://cutoutwiz.com/nl";
      }
      if (data.country_name == "Thailand") {
        window.location.href = "https://cutoutwiz.com/th";
      }
    },
  });

  $(document).ready(function () {
    $(".btn1show").click(function () {
      $("#js-nametag1").show();
      $("#video-size1").show();
      $("#video-size2").hide();
      $("#video-size3").hide();
      $("#video-size4").hide();
      $("#js-nametag2").hide();
      $("#js-nametag3").hide();
      $("#js-nametag4").hide();
    });

    $(".btn2show").click(function () {
      $("#js-nametag2").show();
      $("#video-size2").show();
      $("#video-size1").hide();
      $("#video-size4").hide();
      $("#video-size3").hide();
      $("#js-nametag1").hide();
      $("#js-nametag3").hide();
      $("#js-nametag4").hide();
    });

    $(".btn3show").click(function () {
      $("#js-nametag3").show();
      $("#video-size3").show();
      $("#video-size1").hide();
      $("#video-size2").hide();
      $("#video-size4").hide();
      $("#js-nametag2").hide();
      $("#js-nametag1").hide();
      $("#js-nametag4").hide();
    });

    $(".btn4show").click(function () {
      $("#js-nametag4").show();
      $("#video-size4").show();
      $("#video-size1").hide();
      $("#video-size2").hide();
      $("#video-size3").hide();
      $("#js-nametag2").hide();
      $("#js-nametag1").hide();
      $("#js-nametag3").hide();
    });

    var quotea = $(".quotea");

    if (c == 1) {
      var quoteIndex = -1;

      function showNextQuote() {
        ++quoteIndex;
        c++;
        quotea
          .eq(quoteIndex % 8)
          .fadeIn(900)
          .delay(6500)
          .fadeOut(900, showNextQuote);
      }

      showNextQuote();
    }

    $(
      ".termly-styles-module-root-28a62e termly-styles-module-primary-348988 termly-styles-module-solid-f59bb1 termly-styles-declineButton-35ef05 t-declineButton"
    ).click(function () {
      window.location.reload("/");
    });

    // setTimeout(function() {
    //   $("#refresh").reload(window.location.href + " #refresh");
    //     }, 5000);

    // var y = document.getElementById('refresh').innerHTML;

    // setTimeout(function() {
    //      document.getElementById('refresh').innerHTML = y;
    //     }, 9000);
  });

  function refreshPage() {
    window.location.reload("/");
  }

  const settings = {
    dots: true,
    infinite: true,
    slidesToShow: 3,
    slidesToScroll: 1,
    autoplay: true,
    speed: 1000,
    autoplaySpeed: 4000,
    cssEase: "linear",

    responsive: [
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
          initialSlide: 1,
        },
      },
    ],
  };

  window.addEventListener("scroll", () => {
    let content = document.querySelector(".fade-in-text");
    let contentPosition = content.getBoundingClientRect().top;
    let screenPosition = window.innerHeight;

    if (contentPosition < screenPosition) {
      content.classList.add("active");
    } else {
      content.classList.remove("active");
    }
  });

  window.addEventListener("scroll", () => {
    let content = document.querySelector(".fade-in-text40k");
    let contentPosition = content.getBoundingClientRect().top;
    let screenPosition = window.innerHeight;

    if (contentPosition < screenPosition) {
      content.classList.add("active");
    } else {
      content.classList.remove("active");
    }
  });

  window.addEventListener("scroll", () => {
    let content = document.querySelector(".fade-in-text92k");
    let contentPosition = content.getBoundingClientRect().top;
    let screenPosition = window.innerHeight;

    if (contentPosition < screenPosition) {
      content.classList.add("active");
    } else {
      content.classList.remove("active");
    }
  });

  window.addEventListener("scroll", () => {
    let content = document.querySelector(".fade-in-text54k");
    let contentPosition = content.getBoundingClientRect().top;
    let screenPosition = window.innerHeight;

    if (contentPosition < screenPosition) {
      content.classList.add("active");
    } else {
      content.classList.remove("active");
    }
  });

  return (
    <div className="spain">
      <Router>
        <Navigationes />
      </Router>
      <Helmet>
        <title>CutOutWiz : Image and Video Post Production</title>
        <meta
          name="description"
          keywords="Product photo edinting company"
          content="CutOutWiz is one of the leading image and video editing company for businesses all over the world. As the world moves towards a virtual business base, product photo editing has been a very important part for any E-commerce business "
        />
      </Helmet>

      {/*Banner section */}

      <div
        id="homeid"
        style={{
          backgroundImage: `url('assets/images/CUTOUTWIZ WEBSITE LIGHT VERSION L-02.png')`,
          backgroundPosition: "center",
          backgroundSize: "cover",
          backgroundRepeat: "no-repeat",
          width: "100vw",
          height: "100vh",
          marginTop: "-7%",
        }}
      >
        {/* <img src="assets/images/bannerpic.png"/> */}
        <div class="container" style={{ marginTop: "5%" }}>
          <div class="row">
            <div id="type-text" class="col-md-5" style={{ marginTop: "13%" }}>
              <p
                id="we-do"
                style={{
                  fontSize: "38px",
                  fontFamily: "Branch",
                  fontWeight: "700",
                }}
              >
                Hacemos Imagen y Vídeo
              </p>
              <p
                id="we-doI"
                style={{
                  fontSize: "38px",
                  fontFamily: "Branch",
                  marginTop: "-30px",
                  fontWeight: "700",
                }}
              >
                <Typical
                  steps={[
                    "Edición",
                    1000,
                    "Corrección de color",
                    500,
                    "Retoque",
                    500,
                    "Automatización",
                    500,
                  ]}
                  loop={Infinity}
                  wrapper="p"
                />
              </p>

              <p style={{ fontSize: "20px", fontFamily: "Poppins" }}>
                Tu one-stop
                <br />
                solución de postproducción de contenidos
              </p>

              <div class="row">
                <div class="col-6 ">
                  <a class="" href="https://app.cutoutwiz.com/" target="_blank">
                    <button class="button1">PRUEBA GRATIS</button>{" "}
                  </a>
                </div>

                <div class="col-6 ">
                  <Link to="/es/contact-us">
                    <button type="button" id="button2">
                      COTIZACIÓN GRATIS
                    </button>
                  </Link>
                </div>
              </div>
            </div>

            <div id="img-banner" class="col-md-7">
              <div style={{ marginTop: "10%" }}>
                <img
                  id="back-cover"
                  style={{}}
                  src="assets/images/banner-model-before.png"
                  height="100%"
                  width="100%"
                />
              </div>

              <div class="hide-large">
                <div style={{ marginTop: "10%" }}></div>
                <img
                  id="back-ban"
                  src="assets/images/bannertest.png"
                  style={{ position: "relative", top: "27px" }}
                  height="92%"
                  width="92%"
                />

                <img
                  id="back-cove"
                  src="assets/images/banner-model-before.png"
                  style={{
                    position: "absolute",
                    top: "0px",
                    marginTop: "10%",
                    left: "0px",
                  }}
                  height="100%"
                  width="100%"
                />
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Banner card section */}

      <div
        class="cardid"
        style={{
          backgroundImage: `url('assets/images/CUTOUTWIZ WEBSITE LIGHT VERSION L-03.png')`,
          backgroundPosition: "center",
          backgroundColor: "#062220",
          backgroundSize: "cover",
          backgroundRepeat: "no-repeat",
          height: "104vh",
          width: "100vw",
        }}
      >
        <div class="container">
          <div class="row">
            <div class="col-6 col-md">
              <div
                class="card"
                style={{
                  border: "black",
                  width: "100%",
                  borderRadius: "10px",
                  backgroundColor: "#e3e6d8",
                  color: "white",
                  boxShadow: "1px 2px 3px 4px rgba(12,12,12,0.2)",
                }}
              >
                <img
                  src="assets/images/image.png"
                  width="30%"
                  height="10%"
                  alt="Image icon"
                />
                <br />
                <div class="card-body" style={{ marginTop: "-3%" }}>
                  <h4 style={{ color: "#000000" }} class="card-title">
                    16,500+
                  </h4>
                  <hr
                    style={{
                      width: "32%",
                      border: "1px solid #000000",
                      backgroundColor: "#000000",
                      opacity: "1",
                      marginTop: "-1%",
                    }}
                  ></hr>
                  <p
                    class="card-text"
                    style={{
                      marginTop: "-7%",
                      fontWeight: "500",
                      color: "#000000",
                    }}
                  >
                    Imágenes
                    <br />
                    Procesadas Diar..
                  </p>
                </div>
              </div>
            </div>

            <div class="col-6 col-md">
              <div
                class="card"
                style={{
                  border: "black",
                  width: "100%",
                  borderRadius: "10px",
                  backgroundColor: "#e3e6d8",
                  color: "white",
                  boxShadow: "1px 2px 3px 4px rgba(12,12,12,0.2)",
                }}
              >
                <img
                  src="assets/images/team.png"
                  width="30%"
                  height="10%"
                  alt="Team icon"
                />
                <br />
                <div class="card-body" style={{ marginTop: "-3%" }}>
                  <h4 style={{ color: "#000000" }} class="card-title">
                    500+
                  </h4>
                  <hr
                    style={{
                      width: "32%",
                      border: "1px solid #000000",
                      backgroundColor: "#000000",
                      opacity: "1",
                      marginTop: "-1%",
                    }}
                  ></hr>
                  <p
                    class="card-text"
                    style={{
                      marginTop: "-7%",
                      fontWeight: "500",
                      color: "#000000",
                    }}
                  >
                    Miembros <br />
                    Del Equipo
                  </p>
                </div>
              </div>
            </div>

            <div class="col-6 col-md">
              <div
                class="card"
                style={{
                  border: "black",
                  width: "100%",
                  borderRadius: "10px",
                  backgroundColor: "#e3e6d8",
                  color: "white",
                  boxShadow: "1px 2px 3px 4px rgba(12,12,12,0.2)",
                }}
              >
                <img
                  src="assets/images/support.png"
                  width="30%"
                  height="10%"
                  alt="Support icon"
                />
                <br />
                <div class="card-body" style={{ marginTop: "-3%" }} id="text">
                  <h4 style={{ color: "#000000" }} class="card-title">
                    365 Días
                  </h4>
                  <hr
                    style={{
                      width: "32%",
                      border: "1px solid #000000",
                      backgroundColor: "#000000",
                      opacity: "1",
                      marginTop: "-1%",
                    }}
                  ></hr>
                  <p
